var s = '';

function isValid(s) {
    let max = 0;
    let min = 0;
    let dict = {}; //{ 'a': 1 }
    //let ts = s + ' ';
    for (let i = 0; i < s.length; i++) {
        if (dict[s[i]] !== undefined) {
            let cnt = dict[s[i]] + 1;
            dict[s[i]] = cnt;
        } else {
            dict[s[i]] = 1
        }
    }
    let dict2 = {}; //{1: 1} 
    for (var key in dict) {
        var val = dict[key];
        if (max == 0 && min == 0) {
            max = val;
            min = val;
        } else if (val > max) {
            max = val;
        } else if (val < min) {
            min = val;
        }
        if (dict2[val] !== undefined) {
            let cnt = dict2[val] + 1;
            dict2[val] = cnt;
        } else {
            dict2[val] = 1;
        }
    }

    console.log(dict);
    console.log(dict2);
    console.log(max);
    console.log(min);

    if (dict2.length > 2) {
        return "NO";
    } else {
        if (dict2[min] < dict2[max] && dict2[min] == 1) {
            if (min == 1) {
                return "YES";
            }            
        } else if (dict2[min] > dict2[max] && dict2[max] == 1) {
            if (max - min > 1) {
                return "NO";
            }
            return "YES";
        } else if (max == min) {
            return "YES";
        }
    }

    return "NO";
}

let result = isValid(s);

console.log(result);
